function renderError(err) {
  let errorMessagee = document.getElementById('error-message')
  errorMessagee.innerHTML = err.message
  errorMessagee.className = ''
}

async function renderAllPublished() {
  try {
    GambleSaleListingFactory = new web3js.eth.Contract(GambleSaleListingFactoryContract.abi,
                                                       GambleSaleListingFactoryContract.networks[NETWORK_ID].address)

    let published = await GambleSaleListingFactory.methods.fetch().call()
    
    let items = ''

    published.forEach(address => {
      items += `<li>${address}</li>`
    });

    document.getElementById('index-view-content').innerHTML = items
  } catch (err) {
    renderError(err)
  }
}

async function renderPublishNew() {
  let formButton = document.getElementById('form-submit')
  
  formButton.innerHTML = 'Publish'
  
  formButton.onclick = async () => {
    const GambleSaleListingFactory = new web3js.eth.Contract(GambleSaleListingFactoryContract.abi, 
                                                             GambleSaleListingFactoryContract.networks[NETWORK_ID].address)

    let ipfsAddressId = document.getElementById('ipfs-address-id').value
    let ipfsItemContentHash = document.getElementById('ipfs-item-content-hash').value
    let itemLocation = document.getElementById('item-location').value
    let itemCarrier = document.getElementById('item-carrier').value
    let price = document.getElementById('price').value
    let slots = document.getElementById('slots').value
    
    let accounts = await web3js.eth.getAccounts()

    try {
      await GambleSaleListingFactory.methods.publish(
        ipfsAddressId,
        ipfsItemContentHash,
        itemLocation,
        itemCarrier,
        price,
        slots
      ).send({ from: accounts[0], value: web3js.utils.toWei(`${price}`, 'ether') })

      location.reload()
    } catch (err) {
      renderError(err)
    }
  }
}

window.addEventListener('load', async function() {
  if (window !== undefined && window.ethereum !== undefined) {
    web3js = new Web3(window.ethereum)

    let accounts = await web3js.eth.getAccounts()
    let mmConnect = document.getElementById('metamask-connect')

    if (accounts.length === 0) {
      mmConnect.innerHTML = 'Connect MetaMask'

      mmConnect.onclick = async () => {
        try {
          await window.ethereum.enable()
          location.reload()
        } catch (err) {
          renderError(err)
        }
      }
    } else {
      document.getElementById('content').className = ''
      mmConnect.innerHTML = 'Current Account: ' + accounts[0]
      renderAllPublished()
      renderPublishNew()
    }
  } else {
    window.alert('Install MetaMask to Proceed!')
  }

})